    <h3 style="margin-top:20px; padding:0 20px;">
        Dan kalau suatu hari kamu tanya aku,<br>
        "Kamu masih pilih aku nggak?"<br><br>
        Jawabannya tetap sama:<br>
        Aku pilih kamu. Lagi. Dan lagi. Dan lagi. ‚ù§Ô∏è

<script>
const yesBtn = document.getElementById("yesBtn");
const noBtn = document.getElementById("noBtn");
const result = document.getElementById("result");

noBtn.addEventListener("mouseover", () => {
    const x = Math.random() * (window.innerWidth - 120);
    const y = Math.random() * (window.innerHeight - 60);
    noBtn.style.left = x + "px";
    noBtn.style.top = y + "px";
});

yesBtn.onclick = () => {
    result.classList.remove("hidden");
    document.body.style.background = "linear-gradient(135deg, #ff4d6d, #ff8fab)";
    startHearts();
    startTyping();
    startCounter();
};

const text = `
Lilis Tiaaa ü§ç

Semua ini berawal dari sosialisasi anak KKN di SMA.
Dari seorang mahasiswa KKN dan seorang siswi SMA
yang awalnya cuma sekadar kegiatan biasa.

Tapi ternyata bukan cuma kegiatan.
Itu awal cerita kita.

20 September 2025 ü§ç
hari dimana kamu resmi jadi bagian hidup aku.

Sejak itu,
hari-hari aku nggak pernah sama lagi.
Karena sekarang ada kamu di dalamnya.
`;

let i = 0;
function startTyping() {
    const typingEl = document.getElementById("typingText");
    typingEl.innerHTML = "";
    function type() {
        if (i < text.length) {
            typingEl.innerHTML += text.charAt(i);
            i++;
            setTimeout(type, 35);
        }
    }
    type();
}

function startCounter() {
    const counterEl = document.getElementById("counter");
    const startDate = new Date("September 20, 2025 00:00:00");

    setInterval(() => {
        const now = new Date();
        const diff = now - startDate;

        const days = Math.floor(diff / (1000 * 60 * 60 * 24));
        const hours = Math.floor((diff / (1000 * 60 * 60)) % 24);
        const minutes = Math.floor((diff / (1000 * 60)) % 60);
        const seconds = Math.floor((diff / 1000) % 60);

        counterEl.innerHTML =
            "Kita sudah bersama selama üíû " +
            days + " hari " +
            hours + " jam " +
            minutes + " menit " +
            seconds + " detik ‚ù§Ô∏è";
    }, 1000);
}

function startHearts() {
    setInterval(() => {
        const heart = document.createElement("div");
        heart.innerHTML = "üíñ";
        heart.classList.add("heart");
        heart.style.left = Math.random() * window.innerWidth + "px";
        heart.style.animationDuration = (Math.random() * 3 + 2) + "s";
        document.body.appendChild(heart);
        setTimeout(() => heart.remove(), 5000);
    }, 300);
}
</script>
